import React from "react";
import styles from './SideSection.module.css'


function SideSection(prop){

    const result=''

    function handleClick(){
        result=`${prop.text}`
    }

    return(
        <div className={`text-light d-flex ${styles['container-section']} `}>
            <icon className={`${styles['icon-section']}`}>
                {prop.icon}
            </icon>
            <h5 onClick={handleClick} className={`${styles['text-section']}`}>{prop.text}</h5>
        </div>
    )
}

export default SideSection
